import React from 'react'
import Button from "./Button";

class Buttons extends React.Component {
    render() {
        let ButtonConstructor = this.props.action
            .map( action => <Button name={action.title} onClick={action.callback} /> );
        return (
            <div>
                { ButtonConstructor }
            </div>


        )
    }
}

export default Buttons;
